-- This script creates and populates the table that holds
-- required datum transformation and projection parameters
-- for geographic and projected coordinate systems

DROP TABLE prospatial_reference_systems;
CREATE TABLE prospatial_reference_systems (
  spatial_reference_id int,
  well_known_text nvarchar(max)
);
SET NOCOUNT ON;
